## What did you do? 

```
//Mesh
msh1 = Dynamo.Mesh.Remesh(Dynamo.Mesh.Translate(Dynamo.Mesh.ImportFile(fil), -399000, -801000, 0));

//Slice intervals
intr = 250;

//Bounding Cuboid
