b"## Dynamo version

2.3.0.5885

## Operating system

Windows 10

## What did you do? 
Simple example on enabling profiling on Workspace changed.

```csharp
private void OnWorkspaceChanged(IWorkspaceModel workspace)
{
    HomeWorkspaceModel homeWorkspace = workspace as HomeWorkspaceModel;

    if (homeWorkspace == null)
        return;

    homeWorkspace.EngineController.EnableProfiling(true, homeWorkspace, homeWorkspace.Nodes);
}
```

## What did you expect to see?

Profiling enabled for the newly opened workspace.

## What did you see instead?

Profiling can be enabled only when the current `EngineController`'s private `AstBuilder` property doesn't have an active `ProfilingSession`. This is fine but for the fact that when opening a new file (changing the workspace), the `EngineController` gets reseted with a new instance and subsequently, its `AstBuilder`.

Problem is that this reset happens **after** the `WorkspaceChanged` event gets fired, so by the time we can enable profiling on the subscribed event, the `EngineController` gets reseted and profiling back to be disabled.

https://github.com/DynamoDS/Dynamo/blob/master/src/DynamoCore/Models/DynamoModel.cs#L1541-L1570

```csharp
private bool OpenJsonFileFromPath(string fileContents, string filePath, bool forceManualExecutionMode)
{
    try
    {
        DynamoPreferencesData dynamoPreferences = DynamoPreferencesDataFromJson(fileContents);
        if (dynamoPreferences != null)
        {
            // TODO, QNTM-1101: Figure out JSON migration strategy
            if (true) //MigrationManager.ProcessWorkspace(dynamoPreferences.Version, xmlDoc, IsTestMode, NodeFactory))
            {
                WorkspaceModel ws;
                if (OpenJsonFile(filePath, fileContents, dynamoPreferences, forceManualExecutionMode, out ws))
                {
                    OpenWorkspace(ws); // <-- THIS FIRES 'WorkspaceChanged' EVENT

                    //Raise an event to deserialize the view parameters before
                    //setting the graph to run
                    OnComputeModelDeserialized();

                    SetPeriodicEvaluation(ws); // <-- THIS RESETS 'EngineController' AND SUBSEQUENTLY DISABLES PROFILING
                }
            }
        }
        return true;
    }
    catch (Exception e)
    {
        Console.WriteLine(e.Message);
        return false;
    }
}
```

cc'ing @mjkkirschner @ColinDayOrg "

