b"## Background

`RecordableCommand` and its derived classes were introduced to automate Dynamo. Certain user actions are recorded in the form of `RecordableCommand` which can then be serialized into `XML` files for subsequent playback. The primary usage of `RecordableCommand` is in unit test cases that simulate user scenarios, complete with UI. Another recent application is the use of it in `Dynamo Web Server` as a way to repeat user actions that take place on the web client.

`RecordableCommand` were written to work with `DynamoViewModel`, which means components that make use of the command framework cannot get rid of `DynamoViewModel` and go without a UI (headless). This poses a problem for `Dynamo Web Server` which needs to automate `DynamoModel` through `RecordableCommand` but without a UI.

This issue has been highlighted and discussed extensively [in another pull request](https://github.com/pboyer/Dynamo/pull/2).
## Solution

To solve this problem, `RecordableCommand` and its derived classes need to be moved to `DynamoModel`, allowing automation without `DynamoViewModel`. Primary goals of this design change should include:
1. Allow usage of `RecordableCommand` on the model layer alone (e.g. `WorkspaceModel`).
2. Allow for a clean separation between `DynamoViewModel` and `DynamoModel`.
3. Retain command recording functionality on `DynamoViewModel` (i.e. `AutomationSettings` class).
4. Retain command playback functionality (i.e. `DynamoSandbox.exe /c <command-file-path>`).
5. Ensure zero regression in `RecordedTests`.
## Changes

All the changes can and should be done on `master` branch for the following reasons:
1. It is an isolated change that is independent of the core splitting and web server efforts.
2. It can ensure the changes are exercised by the continuous integration system.
3. It can reduce the changes in [core splitting branch](https://github.com/pboyer/Dynamo/tree/DynamoCoreSplit) and [web server branch](https://github.com/Benglin/Dynamo/tree/Reach).
#### The following changes are required:
- Introduce `CommandStarting` and `CommandCompleted` events from `DynamoModel`:

``` cs
internal delegate void RecordableCommandHandler(RecordableCommand command);

class DynamoModel
{
    internal event RecordableCommandHandler CommandStarting;
    internal event RecordableCommandHandler CommandCompleted;
}
```
- Add event handlers in `DynamoViewModel` class as private event handlers `OnCommandStarting` and `OnCommandCompleted`.
- Move `RecordableCommand` (and all subclasses) as nested class of `DynamoModel`. Make `RecordableCommand.Execute/ExecuteCore` methods take `DynamoModel`. Since `AutomationSettings` relies on `DispatcherTimer` it cannot be moved to `DynamoModel`, it needs to remain in `DynamoViewModel`. Introduce a new `DynamoModel.ExecuteCommand` method. The working relationship between `DynamoViewModel.ExecuteCommand` and `DynamoModel.ExecuteCommand` methods look something like this:

``` cs
class DynamoViewModel
{
    public void ExecuteCommand(DynamoModel.RecordableCommand command)
    {
        if (null != this.automationSettings)
            this.automationSettings.RecordCommand(command);

        this.model.ExecuteCommand(command);
    }
}

class DynamoModel
{
    public void ExecuteCommand(DynamoModel.RecordableCommand command)
    {
        if (this.CommandStarting != null)
            this.CommandStarting(command);

        command.Execute(this);

        if (this.CommandCompleted != null)
            this.CommandCompleted(command);
    }
}
```
- Handle `CommandStarting` and `CommandCompleted` events in `DynamoViewModel` (this is required only for those commands that actually do something that can only be done on `DynamoViewModel` layer). Check the types of the incoming `command` (through a `switch-case`) and perform respective `ViewModel` specific actions. It is also very important that things like `RaisePropertyChanged` stay in `DynamoViewModel` layer because those are meant for `DynamoView`, we don't want to disconnect them.
- As part of command execution flow, anything similar to the following pattern:

```
DynamoModel > OnCommandStarting > DynamoViewModel > WorkspaceViewModel > WorkspaceModel
```

Should be simplified to just do the following:

```
DynamoModel > WorkspaceModel
```
- Remove `DynamoViewModel.XyzImpl` methods that were used in `XyzCommand.ExecuteCore` methods. Any of the `DynamoModel` method that are called only from within `XyzCommand.ExecuteCore` should be made private.
## Suggested test scenarios

The following test scenarios should be done for this change:
1. Exercise all commands as a user, then press `CTRL + SHIFT + R` to generate the XML file, see if the XML file contains all the commands.
2. Copy the full path of that XML file, and do `DynamoSandbox.exe /c C:\path\to\file.xml`, it should replay the actions you have done in Step 1.
3. All recordable tests should produce the results they do as of today.
## Outstanding questions
1. Where does `DynamoSelection` fall in? It looks like a component for `DynamoModel` (when it does get there, it should also be a data member of `DynamoModel` instead of being a singleton).
"

